import React from "react";
import {BrowserRouter as Router, Route, Link} from "react-router-dom";
import {Login} from "./Login";
import {Register} from "./Register";
import {Profile} from "./Profile";
import CourseListComponent from "./CourseListComponent";
import {CourseEditor} from "./CourseEditor";


export class CourseManager extends React.Component {
  render() {
    return(
        <Router>
          <div style={{
            backgroundColor: 'blue',
            width: '1000px',
            height: '1000px'
          }}>
            <Link to="/login" className="wbdv-nudge-over">Login</Link>
            <Link to="/register" className="wbdv-nudge-over">Register</Link>
            <Link to="/profile" className="wbdv-nudge-over">Profile</Link>
            <Link to="/courses" className="wbdv-nudge-over">Course List</Link>
            <Route path="/login" exact component={Login}/>

            <Route path="/register" exact component={Register}/>
            <Route path="/profile" exact component={Profile}/>
            <Route path="/courses" exact component={CourseListComponent}/>
            <Route path="/edit/:courseId" exact component={CourseEditor}/>
          </div>
        </Router>
    )
  }
}
